arrangement.p:
The materials are arranged in nine series: Series 1. Audiovisual Materials; Series 2.
        Born-Digital Materials; Series 3. Professional Files; Series 4. Publications and Writing;
        Series 5. Research Files; Series 6. Stanford Prison Experiment; Series 7. Teaching Files;
        Series 8. Oversized Materials; Series 9. Restricted Materials.

This series is arranged into several subseries, including: academic files;
            awards/grants; biographical; correspondence; court cases; lectures/symposia/conferences;
            miscellaneous; photographs; professional organizations (APA); professional organizations
            (other than APA); speeches/eulogies by Zimbardo; and television and film.

Files are arranged into subseries by research topic, which include: burnout; hypnosis;
            madness; persuasion; prisons; shyness; studies; subject files; time; and
            violence/evil.

